All objects are owned by PyO3 library and all apis available with references, while in rust-cpython, you own python objects. Here is example of PyList api: rust-cpython impl PyList { fn new(py: Python) -> PyList {...} fn get_item(&self, py: Python, index: isize) -> PyObject {...}
} pyo3 impl PyList { fn new(py: Python) -> &PyList {...} fn get_item(&self, index: isize) -> &PyObject {...}
} Because PyO3 allows only references to python object, all reference have the Gil lifetime. So the python object is not required, and it is safe to have functions like fn py<'p>(&'p self) -> Python<'p> {} .

